-- ----------------------------
DROP TABLE IF EXISTS `vote_activity`;
CREATE TABLE `vote_activity`  (
  `id` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '主键ID',
  `state` smallint NULL DEFAULT NULL COMMENT '状态值, 0为已删除, 1为正常, 2为锁定',
  `create_time` datetime(0) NOT NULL COMMENT '创建时间',
  `create_by_id` bigint NULL DEFAULT NULL COMMENT '创建者ID',
  `last_change_time` datetime(0) NULL DEFAULT NULL COMMENT '最后修改的时间',
  `change_by_id` bigint NULL DEFAULT NULL COMMENT '最后修改者ID',
  `deleted_time` datetime(0) NULL DEFAULT NULL COMMENT '删除时间',
  `deleted_by_id` bigint NULL DEFAULT NULL COMMENT '删除者id',
  `activity_title` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '活动标题',
  `posters_img` varchar(300) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '活动海报图片链接',
  `start_time` datetime(0) NOT NULL COMMENT '活动开始时间',
  `end_time` datetime(0) NOT NULL COMMENT '活动结束时间',
